import React from "react";
import { Chart } from "chart.js/auto";
import { Bar } from "react-chartjs-2";

const data = {
    labels: ['January', 'February', 'March', 'April', 'May', 'June', 'July', 'August', 'September', 'October', 'November', 'December'],
    datasets: [{
        data: [65, 59, 80, 81, 56, 55, 40, 65, 59, 80, 81, 56, 55, 40],
        backgroundColor: [
            'rgba(186, 104, 200, 0.2)',
            'rgba(171, 71, 188, 0.2)',
            'rgba(156, 39, 176, 0.2)',
            'rgba(142, 36, 170, 0.2)',
            'rgba(123, 31, 162, 0.2)',
            'rgba(106, 27, 154, 0.2)',
            'rgba(94, 53, 177, 0.2)',
            'rgba(186, 104, 200, 0.2)',
            'rgba(171, 71, 188, 0.2)',
            'rgba(156, 39, 176, 0.2)',
            'rgba(142, 36, 170, 0.2)',
            'rgba(123, 31, 162, 0.2)'
        ],
        borderWidth: 0,
        borderRadius: 8
    }]
};

const options = {
    scales: {
        x: {
            grid: {
                display: false
            },
            ticks: {
                color: 'rgba(255, 255, 255, 0.4)'
            }
        },
        y: {
            grid: {
                display: false
            },
            ticks: {
                color: 'rgba(255, 255, 255, 0.4)'
            }
        }
    },

    plugins: {
        legend: {
            display: false
        }
    },

    tooltips: {
        callbacks: {
            label: function (tooltipItem) {
                return tooltipItem.yLabel;
            }
        }
    }
};

export default function FeedbackAmountChart() {
    return (
        <Bar data={data} options={options} />
    );
};
